import styled from "styled-components";

export const PartnerContainer = styled.div`
  width: 100%;
`;

export const PartnerImages = styled.div`
  width: 100%;

  img {
    width: 100px;
    height: auto;
    object-fit: contain;
  }

  display: flex;
  justify-content: center;
  align-items: center;
  gap: 10px;
`;
